import './Expenses.css';
function Expenses(){
    let title=props.title.toLocaleString('en-US',{title:'long'});
    let amount;
    amount = $(props.amount).toLocaleString();
    let date= props.date.getFullYear();
    return (
        <div className={'expenses'}>
            <div>Title</div>
            <div>Amount</div>
            <div>Date</div>
        </div>
    );
}
export default Expenses;
